import React, { Component } from 'react';
import logo from './logo.svg';
import './App.css';

class App extends Component {

  constructor(){
    super()
    this.state = ({
      loaded: false
    })
  }

  componentDidMount(){
    console.log("loaded")
    this.setState({
      loaded: true
    })
  }

  render() {
    return (
      <div className="App">
        <header className="App-header">
          TFSites

          <div className="flex">
            <Frame loaded={this.state.loaded} />
            <Frame loaded={this.state.loaded} />
            <Frame loaded={this.state.loaded} />
          </div>

        </header>
      </div>
    );
  }
} 

export default App;

class Frame extends Component {
  render() {
    if (this.props.loaded) {
    return(
      <div className="frame">
        frame test
      </div>
    )
    }
    else {
      return(
        <div className="frame"></div>
      )
    }
  }
}
